import base64
import ctypes
import subprocess
import sys

from PyQt6.QtCore import Qt, QThread, pyqtSignal
from PyQt6.QtGui import QFont, QIcon, QPixmap
from PyQt6.QtWidgets import (QApplication, QDialog, QHBoxLayout, QLabel,
                             QMainWindow, QMessageBox, QPushButton, QToolBox,
                             QVBoxLayout, QWidget)


class CommandThread(QThread):
    """Ejecuta comandos en una ventana de CMD separada."""
    finished = pyqtSignal()

    def __init__(self, command):
        super().__init__()
        self.command = command
        self.process = None

    def run(self):
        """Ejecuta el comando en una nueva ventana de CMD."""
        try:
            self.process = subprocess.Popen(["cmd", "/k", self.command], creationflags=subprocess.CREATE_NEW_CONSOLE)
            self.process.wait()
        except Exception as e:
            print(f"Error ejecutando el comando: {e}")
        finally:
            self.finished.emit()

    def terminate_process(self):
        """Finaliza el proceso del comando si aún está en ejecución."""
        if self.process:
            self.process.terminate()


